import React from "react";
import { Row,Container } from "reactstrap";
import Savecards from "./Savecards";

class Filecontainer extends React.Component{
    render(){
        return(
            <Container style={{border:"1px solid lightgrey",paddingBottom:"20px",marginTop:"10px"}}>
                <Row>
                    {this.props.result.map(key=>{
                        <Savecards key={key} val={this.props.result[key]}/>
                    })
                    } 
                </Row>
            </Container>
        );
    }
}
export default Filecontainer;
